import React from "react";
import ReactDom from "react-dom";

const App = () => {
  function actionPerform(){
    alert("")
  }
  return (
    <>
      <h1>Welcome React App</h1>
      <button onClick={actionPerform}>Action!!</button>
    </>
  );
};

ReactDom.render(<App />, document.getElementById("root"));
